INSERT INTO [dbo].[article] (id, created_by, creation_date, last_modified_by, last_modified_date, name, status, text, image) VALUES
(1, 'tema105', '2017-02-22 12:38:53:000', 'tema105', '2017-04-14 10:05:37:000', 'testni lanak', 'INACTIVE', '<p>pisem ti pismo da skupa vise nismo <br></p>', 1),
(2, 'tema105', '2017-02-22 15:38:30:000', 'tema105', '2017-04-19 14:55:01:000', 'Plan objave natjeaja za 2017. godinu za mjere ruralnog razvoja', 'ACTIVE', '<p>Objavljen je indikativni plan objave natjeaja za mjere ruralnog razvoja u 2017. godini. <a href="http://ruralnirazvoj.hr/plan-objave-natjecaja/" target="_blank">Plan objave natjecaja</a><br></p>', 2),
(3, 'tema105', '2017-02-27 12:09:55:000', 'tema105', '2017-02-27 12:09:55:000', 'ivica i marica', 'INACTIVE', 'Bio jednom jedan drvosjea koji je sa enom i dvoje djece ivio u maloj kolibi na kraju velike ume. Bili su jako siromani. esto ni kruha nisu dovoljno imali. A ena je bila maeha djeci  djeaku i djevojici. Djeak se zvao Ivica, a djevojica Marica.<br><br><div style="text-align: left;"><p>Zemljom je vladala glad. Nesretni drvosjea jedva je prehranjivao svoju obitelj. Jedne veeri, kad ni kruha nisu vie imali, ena ree:<br> E, ovako se vie ne moe. Biti e najbolje da djecu odvedemo daleko u umu i tamo ih ostavimo. Naloiti emo im vatru, neka se griju. Moda e ih netko dobar pronai i uzeti k sebi. Poslije, kad bude bolje, moemo ih mi opet uzeti.<br> Nesretni otac se pobuni i ree da on to nikako ne moe uiniti. Ali je zla ena navaljivala sve dotle dok on, utuen i bespomoan, na kraju ne pristade uiniti onako kako je ona predlagala. Djeca, koja od gladi nisu mogla zaspati, su sve ula i Marica gorko zaplaka.<br> Ivica je tjeio svoju sestricu:<br> Ne plai, Marice. Biti e dobro.<br> Kad su otac i maeha zaspali, Ivica se polako iulja iz kue. Nebo je bilo puno mjeseine i sjaja zvijezda. Bijeli kamenii rasuti po dvoritu, blistali su poput dragog kamenja. Ivica ih pokupi, napuni depie svojih hlaica, lagano se vrati u kuu i ree Marici:<br> Ne brini, sestrice! Biti e sve dobro. Spavaj.<br> I djeca zaspae, svladana strahom i umorom. Tek to je svanulo, maeha probudi djecu.<br> Ustajte, djeco! Idemo u umu po drva.<br> Dade svakom po komadi kruha i krenue, jedno za drugim. Ivica je iao zadnji i stalno zastajkivao. To je on bacao bijele kamenie da obiljei stazu i da se poslije sa sestrom vrati kui. Maeha primjeti da on neto radi pa ga upita:<br> Zato se stalno okree, Ivice?<br> Gledam u moje bijelo mae. Eno ga, gore, na krovu kue.<br> Maeha nikakvo mae nije vidjela, ali uuti i krene dalje. Uskoro su zali duboko u umu. Otac ode sijei drva, a djeca nakupie suhog granja pa im maeha naloi veliku vatru i ree:<br> Sjedite tu, kraj vatre. Odoh ja pomoi ocu. Poslije emo zajedno kui.<br> Djeca posluae. Uskoro, od umora i straha zaspae. Kad su se probudila, bila je uveliko no. Marica zaplaka, a Ivica je pone tjeiti.<br> Ne plai, sestrice. im doe Mjesec, odvesti u te kui.<br> I zaista. im se Mjesec odvoji od planine, nebo se osu sjajem, a kamenii zabljetae poput malih zvijezda. Dugo su djeca ila tragom kamenia do svoje kue. Tek u zoru zakucae na vrata. <br>Maeha ih izgrdi to su se zadrali u umi, a otac je dugo grlio svoju djecu, presretan to su opet zajedno.<br> Uskoro opet glad ue u malu kolibu. Maeha ree ocu:<br> Osim neto kruha, u kui nemamo ni trunka hrane. Odvedimo djecu u umu! Nai e ih neki dobar ovjek i uzeti k sebi. Kada nama bude bolje, vratiti emo ih kui.<br> Zaludu se nesretni otac opirao. ena je navaljivala i navaljivala pa on, na kraju, pristade. Djeca su ula i ovaj razgovor. Ivica pouri po kamenie, ali su i vrata i prozori bili vrsto zatvoreni. Marica zaplaka, a Ivica je tjeio sestricu:<br> Ne boj se! Biti e sve dobro.<br> Ujutro, rano, maeha probudi djecu, dade im po komadi kruha i tako krenue u umu. I opet je Ivica bio zadnji i bacao mrvice kruha na stazu. Duboko u umi otac ode nasijei drva, maeha naloi vatru i ree:<br> Sjedite tu i ekajte nas! Odoh pomoi ocu. Poslije emo zajedno kui.<br> Djeca pojedoe komadi kruha to ga Marica izvadi iz svoje pregaice i zaspae. Kad su se probudili, bila je ve uveliko no. Vatra se ugasila. Marica zaplaka, a Ivica joj ree:<br> Ne plai, sestrice! im doe Mjesec, odvesti u te kui.<br> Kad se Mjesec pojavi iznad planine, sva no se rasvijetli, ali mrvica kruha nigdje ne bi. Gladne ptice su ih pozobale jo za dana.<br> Ne plai, Marice  ree Ivica.  Nai u ja put do kue.<br> I uze bratac sestricu za ruku. Ili su ili, ali puta ne naoe. I sutradan su stazu traili, ali je uma bivala sve gua. Tek treeg dana, kada od gladi i umora nisu mogli dalje, doletje neka snjenobijela ptica. Ne plaei ih se nimalo, maui krilima, pozva djecu za sobom. Ili su tako Ivica i Marica za pticom sve dok ne stigoe do nekakve male kue. I zastadoe zadivljeni. Gle uda! Kuica bijae sva napravljena od medenjaka, marcipana, okolade. Djeca poee grickati od svega pomalo, a nekakav glas ree:<br> Tko mi kuu moju dira? Tko mi ne da mira!<br> Ivica i Marica odgovorie:<br> Vjetar ludi to iz gore gudi, on ti kuu dira, on ti ne da mira!<br> I nastavie se gostiti. Na kuici se otvore vrata i na njima se pojavi nekakva starica, pogurena, krezuba; ona ree kretavim glasom:<br> Dobra moja djeice! Samo vi rukajte! Uite u kuu. Dati e vama baka jo kolaia.<br> Djeca posluae staricu. A ona ih nahrani i mlijekom napoji i u bijele krevetie na spavanje odvede. Samo to nije bila nikakva dobra baka. Bila je to zla vjetica koja je voljela mamiti djecu k sebi da ih moe zatvoriti u svoju kuicu od kolaa. Ujutro, vjetica grubo prodrma djecu, razbudi ih, Ivicu zatvori u kavez, a Marici naredi:<br> Hajde ljenjivice! Donesi vode, spremi svome bratu doruak. Mora se dobro ugojiti kako bih ga mogla to bre pojesti.<br> Marica gorko zaplaka, ali je morala posluati vjeticu. Dani su prolazili. Marica je prala, vodu nosila, bratu hranu kuhala. Vjetica je svaki dan prilazila kavezu:<br> Prui prst Ivice! Jesi li se ugojio?<br> Pametni djeak bi kroz reetke provukao nekakvu tanku kost, a vjetica, koja nije dobro vidjela, ljutila se to je dijete i dalje mravo. Najzad izgubi strpljenje i naredi:<br> Marice, naloi veliku vatru! Neu vie ekati!<br> Jadna Marica opet zaplaka. Plakala je, plakala, ali nije znala to napraviti. U neka doba vjetica joj ree:<br> Vidi je li vatra dovoljno jaka. elim i kruh ispei. <br>Djevojica se dosjeti:<br> Kako mogu vidjeti kad su vrata tako visoko.<br> Glupa gusko!  naljuti se vjetica  Nisu vrata visoko. Vidi kako ja mogu pogledati.<br> Istog trena kad se vjetica pribliila pei i prignula se vratacima, Marica je svom snagom gurne u vatru, vrsto priklopi vrataca i zalupi rezu. Tako nestade zle vjetice. A Marica pritri kavezu, oslobodi Ivicu viui iz sveg glasa:<br> Slobodni smo, slobodni! Vjetica je mrtva.<br> Njihovoj radosti i veselju nije bilo kraja. Nakupili su pune depove kolaa i medenjaka. Pronali su i vjetiino blago, pa i od njega uzee. Onda pourie da odu to dalje od vjetiine kue. <br>Zaarana uma se pred njima otvarala i djeca zaas stigoe do nekakve velike rijeke. A na njoj ni mosta, ni skele. Djeca ugledae jednu patku pa povikae:<br> Patkice, milenice! Duboka je voda, nemamo broda. Idemo daleko, prenesi nas preko!<br> Patka ih prenese preko vode i djeca nastavie put. uma je bivala sve rjea, dok je sasvim ne nestade. Na ivici ume ukazala se njihova kuica. Ivica i Marica potrae. Provirie kroz prozor i vidjee svoga oca, samog, tunog. Kucnue o okno. <br>Otac podie glavu, ugleda ih. Dugo je grlio svoju djeicu. Visoko ih dizao u zrak, ljubio, vrsto drao. Da se vie nikada ne rastave.<br> I nisu se rastajali. ivjeli su dugo, sretno sve do kraja svoga ivota...</p></div><p><br></p>', 4),
(4, 'tema105', '2017-03-06 10:58:54:000', 'tema105', '2017-03-06 11:02:48:000', 'Najava natjeaja za energetsku uinkovitost', 'ACTIVE', '<p>Natjeaj je najavljen za trei kvartal godine. Prihvatljivi korisnici su mala i srednja poduzea.<br></p>', 9),
(7, 'tema105', '2017-04-13 14:23:57:000', 'tema105', '2017-04-14 10:08:09:000', 'Interes za potpore mladim i malim poljoprivrednicima - mjere 6.1.1. i 6.4.1.', 'ACTIVE', '<p>APPRRR je 12.04.2017. objavio informaciju kako slijedom velikog broja upita i iskazanog interesa infermiraju potencijalne korisnike i zainteresiranu javnost o prijavama na nedavno zavrene natjeaje u sklopu Mjere 6 "Razvoj poljoprivrednih gospodarstava i poslovanja". <br><br>Drugi natjeaj za operaciju <b>6.1.1. "Potpora mladim poljoprivrednicima"</b> bio je raspisan od 21. prosinca 2016. do 24. veljae 2017. godine, a Agencija za plaanja u poljoprivredi, ribarstvu i ruralnom razvoju zaprimila je 813 zahtjeva za potporu u iznosu traene potpore od 306.370.920,00 kn. Raspoloivi iznos potpore za ovaj natjeaj je 75.368.000,00 kn, a maksimalni i fiksni iznos potpore po korisniku 50.000,00 eura u kunskoj protuvrijednosti. <br><br>Za operaciju <b>6.3.1. "Potpora razvoju malih poljoprivrednih gospodarstava"</b> drugi natjeaj bio je raspisan od 27. sijenja do 27. oujka 2017. godine. Zaprimljeno je 4189 zahtjeva za potporu u iznosu traene potpore od 474.988.615,50 kn. Raspoloivi iznos potpore u ovom natjeaju je 151.261.593,00 kn, a visina potpore po korisniku iznosi 15.000 eura u kunskoj protuvrijednosti.&nbsp;&nbsp;</p><p><br></p><p><a href="http://www.apprrr.hr/iznimno-velik-interes-za-potpore-mladim-i-malim-poljoprivrednicima-2282.aspx" target="_blank">iznimno-velik-interes-za-potpore-mladim-i-malim-poljoprivrednicima</a></p><p><br><br></p>', 30),
(8, 'tema105', '2017-04-20 08:57:41:000', 'tema105', '2017-04-20 08:58:34:000', 'Tjedan EU fondova 2017.', 'ACTIVE', '<p>Ministarstvo regionalnoga razvoja i fondova Europske unije, u suradnji s drugim partnerskim institucijama, najavljuje odravanje informativno-edukativnog dogaaja pod nazivom Tjedan EU fondova koji e se odrati <strong>od 24. do 28. travnja 2017.</strong> u hotelu <strong>Sheraton</strong> u Zagrebu (Ulica kneza Borne 2).<br><br> Ministarstvo regionalnoga razvoja i fondova Europske unije je nacionalno tijelo odgovorno za koordinaciju informativnih i obrazovnih aktivnosti o koritenju europskih strukturnih i investicijskih fondova (ESI fondova). Svrha koordinacije je osiguranje pravovremene podrke i jaanja postojeih kapaciteta dravne i javne uprave, jedinica lokalne i regionalne (podrune) samouprave, nevladinih organizacija, znanstvenog sektora i drugih potencijalnih korisnika u aspektima kljunim za uspjeno koritenje sredstava iz ESI fondova.<br><br> Cilj ovog petodnevnog dogaanja je iroj javnosti i potencijalnim korisnicima predstaviti mogunosti koritenja&nbsp;europskih strukturnih i investicijskih fondova,&nbsp; kao i dobrobiti koju oni nose Republici Hrvatskoj. U okviru svakog pojedinog dana predstavit e se mogunosti financiranja iz razliitih tematskih podruja ulaganja u financijskoj perspektivi 2014.-2020., prikazati primjeri dobre prakse i razmijeniti iskustva kroz panel diskusije.</p><p><br></p><p><strong>Detaljan program Tjedna EU fondova moete vidjeti </strong><a href="http://www.strukturnifondovi.hr/UserDocsImages/Novosti/Objedinjeni%20program%20Tjedna%20EU%20fondova%2019.4..pdf" target="_blank" data-fileid="4296"><strong><u><font color="#0066cc">ovdje</font></u></strong></a>.</p><p><a href="http://www.strukturnifondovi.hr/UserDocsImages/Novosti/Objedinjeni%20program%20Tjedna%20EU%20fondova%2019.4..pdf" target="_blank" data-fileid="4296"><strong><u><font color="#0066cc"><br></font></u></strong></a><br></p>', 52);
