(20, 'tema105', '2017-04-14 11:46:35:000', 'tema105', '2017-04-14 11:56:38:000', 'Diversifikacija proizvodnje u akvakulturi i uzgajanih vrsta', 'ACTIVE', '<p>Diversifikacija proizvodnje u akvakulturi i uzgajanih vrsta<br></p>', 32),
(21, 'tema105', '2017-04-14 11:47:07:000', 'tema105', '2017-04-14 11:47:07:000', 'Osuvremenjivanje jedinica akvakulture, ukljuujui poboljanje radnih i sigurnosnih uvjeta radnika u akvakulturi', 'INACTIVE', '<p>Osuvremenjivanje jedinica akvakulture, ukljuujui poboljanje radnih i sigurnosnih uvjeta radnika u akvakulturi<br></p>', 33),
(22, 'tema105', '2017-04-14 11:53:28:000', 'tema105', '2017-04-14 11:53:28:000', 'Poboljanje i osuvremenjivanje povezano sa zdravljem i dobrobiti ivotinja, ukljuujui kupnju opreme za zatitu farmi od divljih grabeljivaca', 'INACTIVE', '<p>Poboljanje i osuvremenjivanje povezano sa zdravljem i dobrobiti ivotinja, ukljuujui kupnju opreme za zatitu farmi od divljih grabeljivaca<br></p>', 34),
(23, 'tema105', '2017-04-14 11:54:04:000', 'tema105', '2017-04-14 11:54:04:000', 'Ulaganje u unaprjeenje kvalitete, ili dodavanje vrijednosti, proizvodima akvakulture', 'INACTIVE', '<p><span class="pt-Zadanifontodlomka">Ulaganje u unaprjeenje kvalitete, ili dodavanje vrijednosti, proizvodima akvakulture</span><br></p>', 35),
(24, 'tema105', '2017-04-14 11:54:45:000', 'tema105', '2017-04-14 11:56:45:000', 'Obnova postojeih akvakulturnih ribnjaka ili laguna putem uklanjanja mulja ili ulaganja u spreavanje taloenja mulja', 'ACTIVE', '<p><span class="pt-Zadanifontodlomka">Obnova postojeih akvakulturnih ribnjaka ili laguna putem uklanjanja mulja ili ulaganja u spreavanje taloenja mulja</span><br></p>', 36),
(25, 'tema105', '2017-04-14 11:55:31:000', 'tema105', '2017-04-14 11:55:31:000', 'Diversifikacija prihoda poduzea u podruju akvakulture putem razvoja komplementarnih aktivnosti', 'INACTIVE', '<p>Diversifikacija prihoda poduzea u podruju akvakulture putem razvoja komplementarnih aktivnosti<br></p>', 37),
(30, 'tema105', '2017-04-14 11:57:54:000', 'tema105', '2017-04-14 11:57:54:000', 'Promicanje zatvorenih akvakulturnih sustava u kojima se proizvodi akvakulture uzgajaju u zatvorenim recirkulacijskim sustavima, smanjujui time potronju vode na najmanju moguu mjeru', 'INACTIVE', '<p><span class="pt-Zadanifontodlomka">Promicanje zatvorenih akvakulturnih sustava u kojima se proizvodi akvakulture uzgajaju u zatvorenim recirkulacijskim sustavima, smanjujui time potronju vode na najmanju moguu mjeru</span><br></p>', 42),
(31, 'tema105', '2017-04-14 11:58:34:000', 'tema105', '2017-04-14 12:00:07:000', 'Ulaganja koja poveavaju energetsku uinkovitost i promiu prelazak poduzea u podruju akvakulture na obnovljive izvore energije', 'ACTIVE', '<p><span class="pt-Zadanifontodlomka">Ulaganja koja poveavaju energetsku uinkovitost i promiu prelazak poduzea u podruju akvakulture na obnovljive izvore energije</span><br></p>', 43),
(35, 'tema105', '2017-04-14 12:01:45:000', 'tema105', '2017-04-14 12:01:45:000', 'Ulaganja koja dovode do znatnog smanjenja uinka poduzea u podruju akvakulture na potronju i kvalitetu vode', 'INACTIVE', '<p><span class="pt-Zadanifontodlomka">Ulaganja koja dovode do znatnog smanjenja uinka poduzea u podruju akvakulture na potronju i kvalitetu vode, posebice smanjenjem koliine koritene vode ili kemikalija, antibiotika i drugih lijekova, ili poboljanjem kvalitete izlazne vode, ukljuujui uspostavom multitrofikih akvakulturnih sustava</span><br></p>', 47),
(36, 'tema105', '2017-04-19 14:57:28:000', 'tema105', '2017-04-19 14:57:28:000', 'Ulaganje u proizvode primarne poljoprivredne proizvodnje', 'INACTIVE', '<p>Primarna poljoprivredna proizvodnja je proizvodnja proizvoda bilinogojstva ili stoarstva bez obavljanja dodatnih radnji kojima bi se promijenila priroda tih proizvoda<br></p>', 49),
(37, 'tema105', '2017-04-19 15:11:45:000', 'tema105', '2017-04-19 15:41:52:000', 'Ulaganja u preradu, marketing i/ili razvoj poljoprivrednih proizvoda', 'ACTIVE', '<p>Prerada&nbsp; poljoprivrednog&nbsp; proizvoda&nbsp; znai&nbsp; svako&nbsp; djelovanje&nbsp; na&nbsp; poljoprivrednom proizvodu iji je rezultat proizvod koji je i sam poljoprivredni proizvod, osim djelatnosti na poljoprivrednim dobrima koje su neophodne za pripremu ivotinjskih ili biljnih proizvoda za prvu prodaju.&nbsp; </p>', 50),
(38, 'tema105', '2017-04-19 15:32:12:000', 'tema105', '2017-04-19 15:41:46:000', 'Ulaganje u informacijske i komunikacijske tehnologije', 'ACTIVE', '<p>Rjeavanje identificiranih slabosti vezanih uz nedostatnu primjenu rjeenja informacijske i komunikacijske tehnologije u poslovnim procesima u malim i srednjim poduzeima.<br></p>', 51);
