(77, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, 'priprema zemljita; \nkrenje zemljita; \ntroak gradnje, rekonstrukcije zgrada, poslovnih prostorija, drugih objekata i ureenje pripadajue \nparcele  \ntroak odravanja i /ili preureenja, modernizacije zgrada, poslovnih prostorija, drugih objekata i \nureenje pripadajue parcele  \nkomunalni doprinos, cijene vodnih i energetskih prikljuaka,  \ntroak uporabne dozvole; \nnabava novih strojeva, opreme, alata, radnih vozila i strojeva, te s njima povezani trokovi aktiviranja, transporta, montae i stavljanja u pogon, ako ih u pogon stavlja dobavlja.  \ntrokovi montae opreme i strojeva ukoliko su prikazani na istom raunu  s nabavljenom opremom te predstavljaju sastavni dio nabave opreme; \nulaganja u mjere energetske uinkovitosti, povezana sa svrhom projekta; \nnabava mjernih ureaja povezanih s projektom; \ntrokovi informatiko-komunikacijskih i audio/video rjeenja (hardver) koji su izravno povezani sa \nsvrhom projekta \nnabava materijalne imovine putem zakupa ako zakup materijalne imovine ima oblik financijskog leasinga i sadrava obvezu korisnika potpore na kupnju imovine nakon isteka ugovora o zakupu. \nNabava patenata, autorskih prava, znanja ili drugih vrsta intelektualnog vlasnitva,  trokovi informatiko-komunikacijskih i audio/video rjeenja (softver) ako udovoljavaju l. 7. Programa dravnih potpora.', 30, 2),
(78, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, '?  Obrazac 1. Prijavni obrazac A; \n?  Obrazac 2. Investicijska studija; \n?  Obrazac 3. Izjava o usklaenosti s UZP-om s datumom ne starijim od 30 (trideset) dana \nprije  datuma  predaje  projektne  prijave,  ovjerena  peatom  i  potpisana  od  strane  osobe \novlatene za zastupanje te ovjerena od strane javnog biljenika; \n?  Obrazac 4. Skupna izjava; \n?  Obrazac 5. Infrastrukturna komponenta projekta (ako je primjenjivo);  \n?  Obrazac 6. Izjava o koritenim potporama;  \n?  Obrazac 7. Izjava o koritenim potporama male vrijednosti za prijavitelja i pojednino za \nsvako povezano poduzee koje se smatra jednim poduzetnikom (ako je primjenjivo); \n?  Potvrda  porezne  uprave  u  izvorniku  da  je  prijavitelj  ispunio  obveze  plaanja  dospjelih \nporeznih  obveza  i  obveza  za  mirovinsko  i  zdravstveno  osiguranje  ne  starija  od  30 \n(trideset) dana od datuma predaje projektne prijave ili vaei jednakovrijedni dokument \nkoji je izdalo nadleno tijelo u dravi sjedita prijavitelja; \n?  BON2/SOL2  sa  stanjem  na  dan  ne  starijim  od  10  (deset)  dana  od  datuma  predaje \nprojektne  prijave  ili  vaei  jednakovrijedni  dokument  koji  je  izdalo  nadleno  tijelo  u \ndravi sjedita prijavitelja.', 31, 2),
(79, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, 'Projektne prijave podnose se u jednom zatvorenom paketu/omotnici iskljuivo preporuenom potanskom poiljkom ili osobnom dostavom od 1. kolovoza 2017. godine, a najkasnije do 31. prosinca 2017.  godine na adresu: \nMinistarstvo gospodrastva, poduzetnitva i obrta \nUlica grada Vukovara 78 \n10000 Zagreb \nNa zatvorenom  paketu/omotnici mora biti jasno naveden naziv  i  referentna oznaka Poziva: KK.03.2.1.05 s naznakom Ne  otvarati  prije  slubenog  otvaranja  prijava, puni naziv i adresa prijavitelja-\nNa paketu/omotnici takoer mora biti zabiljeen datum i tono vrijeme predaje  projektne  prijave.', 32, 2),
(80, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-04-20 08:38:56:000', NULL, 'Trokovi orisnika podmirit e se u skladu s metodom nadoknade, to podrazumijeva da: \n  je troak nastao;  \n- je korisnik platio nastale trokove u cijelosti; \n  korisnik  provjerava prihvatljivost trokova i  podnosi zahtjev za nadoknadom  HAMAG-BICRO-u, s dokazom o uplati; \n  HAMAG-BICRO  provjerava  trokove  te  donosi  zakljuak  o  njihovu odobravanju/odbijanju; \n  MINPO provodi isplate odobrenog iznosa korisniku.  \nRok  za  izvrenje  plaanja  korisniku  je  30  (trideset)  dana  od  dana  isteka  roka  za  pregled predmeta  obveze,  odnosno  30  (trideset)  dana  od  dana  isteka  roka  za  provjeru  Zahtjeva  za predujam/Zahtjeva za nadoknadom sredstava. Isplate Korisniku vre se u kunama.', 33, 2),
(81, 'tema105', '2017-03-06 09:11:08:000', 'tema105', '2017-03-31 13:29:33:000', NULL, 'http://www.strukturnifondovi.hr/natjecaji/1248', 34, 2),
