(83, 'tema105', '2017-03-06 09:15:53:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Poziv je namijenjen MSP koja posluju u jedinicama regionalne i lokalne samouprave u podrujima s razvojnim posebnostima, s ciljem jaanja njihove trine pozicije i poveanja konkurentnosti te ujednaenog razvoja svih podruja RH. Podruja s razvojim posebnostima ovim Pozivom definirana su kao podruja jedinica lokalne samouprave koje pripadaju brdsko-planinskim podrujima sukladno Zakonu o brdsko-planinskim podrujima ili jedinica lokalne samouprave koje se nalaze na otocima i otonim skupinama sukladno Zakonu o otocima ili podruju  jedinica podrune (regionalne) samouprave koje prema indeksu razvijenosti spadaju u I. skupinu i/ili jedinica lokalne samouprave koje spadaju u I., II. i III. skupinu sukladno Odluci o razvrstavanju jedinica lokalne i podrune (regionalne) samouprave prema stupnju razvijenosti.', 1, 3),
