(118, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Trokovi  nabave  standardnih  i  out-of-box  softvera  i  izrade/razvoja  specifinog softvera (dizajniran po mjeri za potrebe korisnika), ukljuujui i njegovo instaliranje, programiranje,  testiranje  i/ili  konfiguraciju  za  potrebe  korisnika  (npr.  DMS,  ERP, CMS, ECM, CRM, CAD, CAM); \nTrokovi za licence za nadogradnju softvera; \nTrokovi  za  koritenje  SaaS  (Software  as  a  Service)  modela/usluge  do  najvie  10% ukupne vrijednosti projekta; \nTrokovi  nabave  raunalne  opreme,  ukljuujui  i  instaliranje,  programiranje  i/ili konfiguraciju za potrebe korisnika;  \nIzdaci  za  ostalu  opremu  i  ureaje  potrebne  za  izravne  projektne  aktivnosti  (UPS, aktivna i pasivna mrena oprema, mreni ormar/rack, itd.); \nTrokovi obuke zaposlenika za koritenje novih sustava; \nTrokovi za manje infrastrukturne zahvate/radove potrebne za uvoenje IKT sustava (npr.  umreavanje  opreme,  strukturno  kabliranje,  konstrukcija  server  sobe,  itd.),  za koje nije potrebna graevinska dozvola/potvrda glavnog projekta/rjeenje za graenje, do najvie 20.000,00 HRK; \nTrokovi za usluge vanjskog strunjaka za pripremu i provoenje postupaka nabave, do najvie 10.000,00 HRK; \nTrokovi usluga vanjskog strunjaka za voenje projekta, do najvie 10.000,00 HRK; \nTrokovi usluge financijske revizije, za projekte s potporom jednakom ili veom od 500.000,00 HRK do najvie 10.000,00 HRK;', 30, 3),
(119, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Obrazac 1. Prijavni obrazac A; \nObrazac 2. Prijavni obrazac B;  \nObrazac 3. Izjava o usklaenosti s Uputama za prijavitelje s datumom ne starijim od 30 dana  prije  datuma  predaje  projektne  prijave,  ovjerena  peatom  i  potpisana  od  strane osobe ovlatene po zakonu za zastupanje te ovjerena od strane javnog biljenika;  \nObrazac  4.  Skupna  izjava  ovjerena  peatom  i  potpisana  od  strane  osobe  ovlatene  po zakonu za zastupanje;  \nObrazac 5. Izjava o nekanjavanju (pojedinano za svaku osobu ovlatenu po zakonu za zastupanje prijavitelja / za svaki povezani subjekt / za svaki partnerski subjekt);  \nObrazac 6. Izjava o koritenim potporama male vrijednosti za prijavitelja i pojedinano za  svako  povezano  poduzee  koje  ini  jednog  poduzetnika,  ovjerene  peatom  i potpisane od strane osobe ovlatene po zakonu za zastupanje za predmetno poduzee; \nPotvrda porezne uprave u izvorniku da je prijavitelj, kao i povezani subjekt/i i partnerski subjekt/i  ispunio  obveze  plaanja  dospjelih  poreznih  obveza  i  obveza  za  mirovinsko  i zdravstveno osiguranje ne starija od 30 dana od datuma predaje projektne prijave\nBON2/SOL2  u  izvorniku  sa  stanjem  na  dan  ne  starijim  od  5  dana  od  datuma  predaje projektne prijave.', 31, 3),
(120, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'Projektne prijave podnose se u jednom zatvorenom paketu/omotnici iskljuivo preporuenom potanskom poiljkom ili osobnom dostavom na sljedeu adresu: \nMinistarstvo poduzetnitva i obrta \nUlica grada Vukovara 78 \n10000 Zagreb \nNa zatvorenom paketu/omotnici mora biti jasno navedena naziv i referentna oznaka Poziva s naznakom  Ne  otvarati  prije  slubenog  otvaranja  prijava,  puni  naziv  i  adresa prijavitelja.', 32, 3),
(121, 'tema105', '2017-03-06 09:15:54:000', 'tema105', '2017-04-19 15:25:52:000', NULL, 'MINPO  provodi  isplate  odobrenog  iznosa  korisniku.  Rok  za  izvrenje  plaanja Korisniku  je  30  dana  od  dana  isteka  roka  za  pregled  predmeta  obveze,  odnosno  30 dana od dana isteka roka za provjeru Zahtjeva za predujam/Zahtjeva za nadoknadom sredstava. Isplate Korisniku vre se u kunama.', 33, 3),
