(124, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-13 13:58:40:000', NULL, 'Cilj ovog Poziva  je podrati razvoj novih proizvoda (dobara i usluga), tehnologija i poslovnih procesa  kroz  poveanje  privatnih  ulaganja  u  istraivanje,  razvoj  i  inovacije,  te  jaanje kapaciteta  poduzea  za  istraivanje,  razvoj  i  inovacije,  kroz  poboljanje  njihove  suradnje  s institucijama za istraivanje i razvoj.  Specifini cilj: Novi proizvodi i usluge kao rezultat djelatnosti istraivanja, razvoja i inovacija (IRI).', 1, 4),
