(155, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-14 08:35:00:000', NULL, 'Projekti moraju ukljuivati neke od sljedeih aktivnosti: \n1.  Temeljno istraivanje - eksperimentalni ili teorijski rad s ciljem stjecanja novih znanja o temeljnim naelima fenomena i vidljivih injenica, bez predviene izravne trine primjene ili uporabe \n2.  Industrijsko istraivanje - istraivanje ili kritiki pregled s ciljem stjecanja novih znanja i vjetina za razvoj  novih  ili  znatna  poboljanja  postojeih  proizvoda,  procesa  ili  usluga  odnosno  za  postizanje znatnog poboljanja postojeih proizvoda, procesa ili usluga. Moe ukljuivati izradu prototipova u laboratorijskom okruenju te pilot projekt. \n3.  Eksperimentalni razvoj - stjecanje, kombiniranje, oblikovanje i uporaba postojeih znanja i vjetina u \ncilju razvoja novih ili poboljanja postojeih proizvoda, procesa ili usluga  \n4.  Studija izvedivosti - analiza potencijala projekta, iji je cilj podrati proces donoenja odluka te utvrditi \nresurse potrebne za provedbu projekta i u konanici njegove izglede za uspjeh \n \nProjekti koji obuhvaaju temeljno istraivanje moraju uz sebe imati i neku od drugih aktivnosti. Projekte koji se sastoje samo od izrade studije izvedivosti mogu prijaviti iskljuivo velika poduzea, dok se kod malih i srednjih poduzea studija izvedivosti moe prijaviti iskljuivo u kombinaciji s nekom od ostalih aktivnosti. \n\nKorisnik potpore mora osigurati financijski doprinos od minimalno 25% prihvatljivih trokova iz vlastitih izvora ili u obliku osloboenom od bilo kakve dravne potpore.', 28, 4),
