(159, 'tema105', '2017-04-13 10:24:42:000', 'tema105', '2017-04-14 08:20:06:000', NULL, '- Trokovi plaa osoblja zaposlenog kod prijavitelja i partnera\n- Troak plaa zaposlenih osoba u znanstveno-istraivakim institucijama koje primaju plau iz Dravnog prorauna RH\n- Neizravni  trokovi  (trokovi  najma  prostora,  reijski  trokovi  koji  ukljuuju grijanje/hlaenje, struju, vodu, odvoz otpada i telekomunikacije) nastali izravno kao posljedica  provedbe  istraivakog  projekta\n- Trokovi upravljanja projektom \n- Trokovi  repromaterijala,  potrone  robe  i  slinih proizvoda, koji su  nastali izravno kao posljedica projektnih aktivnosti i temelje se na stvarnim trokovima\n- Trokovi  amortizacije instrumenata i opreme\n- Trokovi  ugovornog  istraivanja, znanja i patenata kupljenih ili licenciranih iz vanjskih izvora po trinim uvjetima, kao i trokovi savjetovanja tehnolokih usluga razliitog tipa i slinih usluga \n- Trokovi ulaganja u materijalnu imovinu koja se koristi za aktivnosti istraivanja i razvoja \n- Trokovi ulaganja u nematerijalnu imovinu\n- Izdaci jamstava za pred-financiranje koja izdaje banka ili druga financijska institucija\n- Izdaci  povezani  s  uslugom  revizije  projekta  za  projekte  iji  ukupno  prihvatljivi trokovi projekta premauju 1.500.000,00 HRK\n- Troak  objavljivanja  vlastitih  rezultata  istraivanja  i  troak  priopavanja  rezultata projekta', 30, 4),
