(165, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:16:24:000', NULL, 'Cilj ovog Poziva je podrati projekte usmjerene ka novim proizvodima i uslugama s viom i visokom dodanom vrijednou koje imaju pozitivan uinak na poslovne rezultate i rast poduzea te s trinim potencijalom na meunarodnoj razini.\nPozivom su predviene:\n       A) Potpore za inovacije za MSP-ove\n       B) Potpore za inovacije procesa i organizacije poslovanja\n       C) Potpore male vrijednosti (pod uvjetom da su dodijeljene potpore navedene u tokama A i B)', 1, 5),
