(192, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-14 08:24:26:000', NULL, 'U  okviru  Poziva  nije  dozvoljena  kombinacija  ESIF  financijskih  instrumenata  i  ESIF  bespovratnih sredstava  za  isti  investicijski  projekt unutar  jedne  operacije  izravno  vezane  uz  istog  korisnika bespovratnih sredstava odnosno krajnjeg primatelja financijskih instrumenata.  \nU skladu s lankom 37. stavkom 9. Uredbe (EU) br. 1303/2013 bespovratna sredstva ne smiju se koristiti za povrat sredstava potpore primljene iz financijskih instrumenata niti se financijski instrumenti smiju koristiti za predfinanciranje bespovratnih sredstava.', 28, 5),
