(196, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:48:56:000', NULL, '1. Potpore za inovacije za MSP-ove (intenzitet potpore ne smije premaivati 50% prihvatljivih trokova)\n	Trokovi savjetodavnih usluga za inovacije  \n	Trokovi pomonih usluga za inovacije \n	Trokovi dobivanja, potvrivanja i zatite patenata i ostale nematerijalne imovine (intelektualnog vlasnitva) \n	Trokovi upuivanja visokokvalificiranog osoblja iz organizacije za istraivanje i irenje znanja ili velikog poduzetnika  na rad na novootvoreno radno mjesto kod poduzetnika\n\n2. Potpore za inovacije procesa i organiziranje poslovanja (intenzitet potpore ne smije premaivati 50% prihvatljivih trokova)\n	Trokovi osoblja (plae osoblja prijavitelja koje je izravno ukljueno u rad na projektnim aktivnostima)\n	Trokovi instrumenata, opreme, zgrada i zemljita vezane uz projektne aktivnosti (za instrumente, opremu i zgrade se smatraju prihvatljivim samo trokovi amortizacije ili zakupa u opsegu i u razdoblju u kojem se upotrebljavaju za projekt; za zemljita se prihvatljivim smatraju samo trokovi ustupanja na komercijalnoj osnovi i stvarno nastali kapitalni trokovi)\n	Reijski trokovi, trokovi materijala, trokovi potrone robe i slinih proizvoda, nastali izravno uslijed projekta\n	Trokovi istraivanja temeljem ugovora s drugim stranama\n	Trokovi znanja i patenata i ostale nematerijalne imovine koji se pribavljaju ili licencijom ustupaju od drugih strana po trinim uvjetima\n\n3. Pratee aktivnosti povezane s provedbom projekta (de minimis potpora iji intenzitet potpore ne smije premaivati 75% prihvatljivih trokova) \n	Revizija projekta\n	Promidba i vidljivost\n	Priprema natjeajne dokumentacije\n	Usluge upravljanja projektom', 30, 5),
(197, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:48:56:000', NULL, '	Prijavni obrazac A\n	Elaborat ekonomske opravdanosti projekta\n	Izjava o usklaenosti s Uputama za Prijavitelje ne starija od 30 dana prije predaje projektne prijave \n	Skupna izjava \n	Izjava o dodijeljenim potporama\n	Izjava o koritenim potporama male vrijednosti \n	Izjava o statusu intelektualnog vlasnitva (IV) na kojem se temelji projektni prijedlog (i popratna dokumentacija o statusu intelektualnog vlasnitva kako je navedeno)  ukoliko je primjenjivo\n	BON2/SOL2 ne stariji od 5 dana prije predaje projektne prijave\n	Potvrda porezne uprave o podmirenju poreznih obveza ne starija od 30 dana prije predaje projektne prijave', 31, 5),
(198, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 13:48:56:000', NULL, 'Projektna prijava podnosi se u jednom tiskanom primjerku i jednom elektronikom primjerku (CD ili DVD s oznakom R) u zatvorenim paketima, iskljuivo preporuenom potanskom poiljkom ili osobnom dostavom na adresu:\nMinistarstvo  gospodarstva, poduzetnitva i obrta\nUlica grada Vukovara 78\n10 000 Zagreb\nNa zatvorenoj omotnici mora biti jasno naveden naziv i referentna oznaka Poziva s naznakom Ne otvarati prije slubenog otvaranja prijava, zatim puni naziv i adresa prijavitelja te mora biti zabiljeen datum i tono vrijeme predaje projektne prijave.\n\nEvaluacija projektnih prijava izvravat e se prema redoslijedu predaje na potu, odnosno osobne predaje u Ministarstvo. Rok za evaluaciju projektnih prijava procjenjuje se na 120 kalendarskih dana od dana zaprimanja projektne prijave. Evaluacija projektnih prijava vri se u nekoliko koraka:\n\n1.	faza  Zaprimanje, registracija i administrativna provjera\n2.	faza  Provjera prihvatljivosti prijavitelja, projekta, aktivnosti i trokova te ocjenjivanje kvalitete\n3.	faza  Odluka o financiranju', 32, 5),
(199, 'tema105', '2017-04-13 13:16:24:000', 'tema105', '2017-04-13 14:25:08:000', NULL, 'Odluka  o  financiranju  se  donosi  za  projektne  prijedloge  koji  su  uspjeno  proli  prethodne  faze  postupka dodjele.  MGPO  e  u  suradnji  s  HAMAG-BICRO-om  i  korisnikom  pripremiti  Ugovor o dodjeli bespovratnih sredstava u  roku  od  30  (trideset) kalendarskih dana od dana donoenja Odluke o financiranju. \nMogunosti  i  uvjeti  za  podnoenje  zahtjeva  za  predujmom/nadoknadom  sredstava  i  koritenje  predujma odreeni su u Ugovoru.  Uvjet za isplatu predujma je bankovna garancija koja se dostavlja HAMAG-BICRO-u. Bankovna garancija mora  glasiti  na  MGPO,  na  iznos  traenog  predujma  s  rokom  vaenja  najmanje  120  (stodvadeset) kalendarskih dana od datuma zavretka razdoblja provedbe Projekta. Korisnik ima pravo zatraiti predujam podnoenjem Zahtjeva za predujmom HAMAG-BICRO-u. Korisnik moe potraivati predujam viekratno, najvie do 40% odobrenih bespovratnih sredstava po projektu.  \nKorisnik podnosi Zahtjev za nadoknadom sredstava (Izvjee o napretku) HAMAG-BICRO-u u roku od 15 dana  od  isteka  svaka  tri  mjeseca  od  dana sklapanja  Ugovora. Trokovi korisnika podmirit e se u skladu s metodom nadoknade. Rok za izvrenje plaanja korisniku je 30 dana od dana isteka roka za pregled predmeta obveze, odnosno 30 dana  od  dana  isteka  roka  za  provjeru  Zahtjeva  za  predujam/Zahtjeva  za  nadoknadom  sredstava.  Isplate Korisniku vre se u HRK.', 33, 5),
